import React from 'react';
import logo from './logo.svg';
import './App.css';

const  estilo ={
  backgroundColor: '#f4f4f4',
  color: '#333',
}

const Li: React.FC<{nombre:string,edad:number}> = ({nombre,edad})=> {
  return <li style={estilo}>hola soy {nombre}, mi edad es de {edad}</li>;
}

const App = () => {
  let nombre: string = "Celeste";
  let edad:number = 20;
  return (
    <ul>
      <Li 
      nombre={nombre}
      edad={edad} ></Li>
    </ul>
  );
};

export default App;
